import Link from 'next/link';
import Header from '../comps/Header';
import Layout from '../comps/MyLayout';

function OpenNewWindow() {
	window.open('/name');
}

export default function Index() {
  return (
    <Layout>
    	<button onClick={OpenNewWindow}></button>
      <p>Hello Next.js</p>
    </Layout>
  );
}
